        // 2. Try to extract from a markdown code block (```json...```)
        const match = geminiOutputText.match(/```json\s*([\s\S]*?)\s*```/);
        if (match && match[1]) {
            textToParse = match[1].trim();
        }

        // 3. Parse the cleaned text
        cleanJsonObject = JSON.parse(textToParse);
    }
} catch (error) {
    console.error("JSON Parsing Error (After Extraction):", error);
}

// --- Fallback Mechanism ---
// 4. If the parsing/extraction failed (cleanJsonObject is still null), 
// create a fallback JSON object using the original input data.
if (!cleanJsonObject) {
    console.warn("WARNING: Failed to parse AI JSON. Creating Fallback object.");

    // Fallback logic using the original input keys (assuming they are available in originalInput)
    cleanJsonObject = {
        "project_summary": originalInput?.project_summary ?? 'N/A (Parse Fail)',
        "Project_category": originalInput?.Project_category ?? 'N/A',
        "client": originalInput?.client ?? 'N/A',
