        "Budget": originalInput?.Budget ?? 0,

        // Placeholders for AI generated fields
        "requestId": "FAIL_" + Date.now(),
        "requirement_summary": "AI Output Failed: Check the Gemini response.",
        "estimated_effort_days": 0, 
        "confidence": "Critical Failure"
    };
}

// 5. Return the successfully parsed object OR the safe fallback object.
return [{ json: cleanJsonObject }];

// Get the output text from the Gemini model. Assuming 'response.text' is the path.
// Adjust the path (e.g., to originalInput?.output) if necessary for your setup.
const inputItem = $input.first();
const originalInput = inputItem?.json;
const geminiOutputText = originalInput?.response?.text ?? originalInput?.output ?? ''; 

let mainAgentData = null;

// --- Step 1: Parse the JSON ---
try {
    // Attempt to clean and parse the JSON string (handles ```json fences too)
    let textToParse = geminiOutputText.match(/```json\s*([\s\S]*?)\s*```/)?.[1]?.trim() ?? geminiOutputText.trim();
    mainAgentData = JSON.parse(textToParse);
} catch (error) {
    console.error("CRITICAL PARSING FAILURE. Using Fallback Data.", error);
    // Fallback: Create a structured error item
    return [{ json: { error_status: "Parsing Failed", message: "Check Gemini output." } }];
}

// --- Step 2: Extract and Split Data for Sub-Agents ---
const subAgents = mainAgentData.sub_agents;

if (!Array.isArray(subAgents)) {
    console.error("Sub-agents list is missing from the parsed JSON.");
    return [{ json: { error_status: "No Agents Array", message: "Controller failed to define agents." } }];
}

// Map the sub_agents array to create separate input items for each 'Call Workflow' node.
const outputItems = subAgents.map(agent => {
    // Create the structured input that will be passed as parameters.
    return {
        json: {
            // Task-specific data (required for the Sub-Agent's prompt)
            task_description: agent.task,
            assigned_role: agent.role,

            // Full project context data (required for the Sub-Agent's processing)
            project_name: mainAgentData.project_name,
            project_category: mainAgentData.project_category,
            client_name: mainAgentData.client_name,
            Deadline_date: mainAgentData.Deadline_date,
            Price: mainAgentData.Price
        }
    };
});

// Return the list of simplified items. Each item is now ready for a Sub-Agent call.
return outputItems;
